import React from 'react';
import styled from 'styled-components';

const Header = () => {
  return (
    <>
      <NavStyled></NavStyled>
    </>
  );
};

const NavStyled = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: #313132;
`;

const UlStyled = styled.ul`
  display: flex;
  list-style: none;
  font-size: 12px;
  margin-left: 10%;
`;

export default Header;
